import { NavStyle,ContainerStyle } from "../styled/ContainerStyle";
import React from 'react'

import Link_ from './Link';

const Nav:React.FC = () =>{
    return (
     <NavStyle>
         <ContainerStyle>
             <span>logo</span>
                <div>
                <Link_ to="/">HOME</Link_>
                <Link_ to="/list">LIST</Link_>
                <Link_ to="/search">SEARCH</Link_>
                </div>
         </ContainerStyle>
     </NavStyle>
    )
}
export default Nav
